class Jar:
    def __init__(self, path, manifest_path=None, manifest_keys=None):
        self.path = path
        self.manifest_path = manifest_path
        self.manifest_keys = manifest_keys or []
        self._manifest = {}

    def _parse_manifest(self, lines):
        for line in lines:
            if not line.strip() or ':' not in line:
                continue
            try:
                key, value = line.split(':', 1)
                key, value = key.strip(), value.strip()
                if any(manifest_key.match(key.lower()) for manifest_key in self.manifest_keys):
                    yield key, value
            except ValueError:
                raise ValueError("Invalid manifest line: {}".format(line))

    def _open(self):
        if not os.path.exists(self.path):
            raise ValueError("path does not exist: {}".format(self.path))
        if not zipfile.is_zipfile(self.path):
            raise ValueError("path is not a zip file: {}".format(self.path))
        if sys.version_info >= (3, 8):
            return zipfile.ZipFile(self.path, strict_timestamps=True)
        else:
            return zipfile.ZipFile(self.path)

    def _get_manifest_path(self, zf):
        if self.manifest_path and self.manifest_path in zf.namelist():
            return self.manifest_path
        return None

    def _read_manifest(self, throw_on_error=False):
        try:
            with self._open() as zf:
                manifest_path = self._get_manifest_path(zf)
                if not manifest_path:
                    return {}

                manifest_info = zf.getinfo(manifest_path)
                if manifest_info.file_size > MAX_FILE_SIZE:
                    raise IOError("manifest file is too big")

                with zf.open(manifest_path) as f:
                    readline_f = functools.partial(f.readline, MAX_FILE_SIZE)
                    manifest_lines = list(x.decode().strip() for x in iter(readline_f, b''))
                    manifest = self._parse_manifest(manifest_lines)
                    return {k: v for k, v in manifest}
        except Exception:
            sys.stderr.write("error while reading manifest of '{}': {}\n".format(self.path, traceback.format_exc()))

            if throw_on_error:
                raise

            return {}

    def manifest(self, throw_on_error=False):
        if not self._manifest:
            self._manifest = self._read_manifest(throw_on_error)
        return self._manifest


