        self.path = path
        self._manifest = {}
        self._dirlist = []

    def _parse_manifest(self, lines):
        version_indication = "version="
        version_lines = [line for line in lines if line.startswith(version_indication)]

        if len(version_lines) > 0:
            version = version_lines[0][len(version_indication):]
            yield 'Version', version.strip()

        field_names = ['Specification-Version', 'Specification-Title', 'Specification-Vendor', 'Implementation-Version', 'Implementation-Title', 'Implementation-Vendor']
        for line in lines:
            if any(line.startswith(field_name) for field_name in field_names):
                    key, value = line.split(':')
                    yield key.strip(), value.strip()

    def _open(self):
        if not zipfile.is_zipfile(self.path):
            raise ValueError("path is not a zip file: {}".format(self.path))
        return zipfile.ZipFile(self.path)

    def _read_dirlist(self):
        with self._open() as zf:
            filenames = dict(p for p in zf.namelist())
            return [f for f in filenames if any(r.search(f.lower()) for r in args.dirlist)]



    def _get_manifest_path(self, zf):
        for path in [args.manifest_path, MANIFEST_OLD_PATH]:
            if path in zf.namelist():
